import React, { useEffect, useState } from "react";
import { Button } from "antd";

const SendRequest = ({ mentor }) => {

  const [fetched, setFetched] = useState(false);

  const cancelMeeting = () => {
    bodyData = JSON.stringify({"mentor": mentor});
    console.log(bodyData);
    fetch(
          "http://localhost:3033/api/mentors" /* Route to send the CSV file to 
                                                    generate the schedule */,
          {
            method: "Delete",
            headers: {
              "Content-Type": "application/json",
              Accept: "application/json",
            },
            body: bodyData,
          }
        )
          .then((response) => response.json())
          .then((result) => {
              alert(result);
          })
          .catch((error) => {
            alert("Error:", error);
          });
  };
  return (
    <>
      <Button type="primary" onClick={cancelMeeting} style={{borderRadius: 5}}>
        Submit
      </Button>
    </>
  );
};

export default SendRequest;
